Tha an so againn ainm Cholla , ainm athar , a shloinneadh is fhar - ainm ann an aon sreath . Cha b ’ urrainn gu ’ n robh na h - ainmean annasach ann an Lunnainn ’ nuair a sgrìobh am Bard . Their cuid gu ’ n d ’ fhuair Colla am far - ainm ‘ ciotach ’ a chionn gu ’ n robh e cho deas leis an laimh chlì , a ’ chiotag no a ’ chearrag , ’ s a bha e leis an laimh dheis , gu ’ n robh e ciotach coingeis , mar theirear ; ach is dòcha gu ’ n robh am facal air a ghnàthachadh mar tha e a nis , agus gu ’ n d ’ fhuair Colla an t - ainm mar gheibh aon dhinn fhein leis an deise a ’ chiotag na an deasag . Cha do lean am far - ainm r ’ a chloinn , co - dhiù ’ s a ’ Ghaidhlig agus anns na crìochan far am b ’ eòlaiche Colla . Cha chluinnear an Colasa ach Alastair Mac Colla , Aonghus Mac Colla . Anns a ’ Bheurla chithear ainm Alastair Mhic Cholla Chiotaich fo iomadh cruth : Colkitto , Colonel Kitto , Young Colkitto , MacColl MacKittish ;
ach ’ s e Burton a chuir an dreach as neònaiche gu léir air — Macdonald of Colkitto ,
mar gu ’ m bu leòb fearainn Colla .
